import test from './Logo.png'
const Project = ({github, projmanage, image, description}) => {
    return ( 
        <div className="flex flex-col gap-y-2 w-[240px] h-[340px] rounded-xl bg-[#30323d] pb-5  ">
            <div className='bg-blue-200 overflow-hidden'>
            <img className="object-scale-down" src={test}></img>
            </div>

            <div className="flex h-auto w-fit m-auto gap justify-evenly bg-blue-300">
            <button className='bg-blue-900 p-1 rounded-sm' onClick={() => window.open("https://www.google.com")}>Code</button>
            <button className='bg-blue-900 p-1 rounded-sm'>Demo</button>
            </div>
            <div className="relative h-2/3 w-[90%] m-auto  rounded-lg bg-white">
            <p>dnwjadjnaw</p>
            </div>
        </div>
     );
}

export default Project;
